import { useEffect } from "react";
import "../scss/ban.css";
import $ from "jquery";


export default function Circle(){

    function upScale_Circle () {
        $(".album_set").click(function () {
            console.log("zzz")
        });
    }

    useEffect(upScale_Circle,[])

    return(
        <>
            <div className="circle_wrapper">
                <div className="circle"></div>
            </div>
        </>
    )
}
